import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click notifications button to open modal
    await page.waitForSelector('#notificationsBtn', { timeout: 5000 });
    await page.click('#notificationsBtn');
    await page.waitForTimeout(1000); // Wait for modal animation

    // Wait for notification items to load
    await page.waitForSelector('.notification-time', { timeout: 5000 });

    // Take screenshot of notification modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_notification_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_notification_modal.png'));

    // Extract all notification time elements
    const timeElements = await page.$$('.notification-time');
    const timeStamps = [];

    for (const element of timeElements) {
      const timeText = await element.evaluate(el => el.textContent.trim());
      timeStamps.push(timeText);
    }

    // Convert relative time strings to timestamp objects
    const timestampData = timeStamps.map(time => {
      const now = new Date();
      let timestamp;

      if (time.includes('second')) {
        const seconds = parseInt(time.match(/\d+/)[0]);
        timestamp = new Date(now.getTime() - seconds * 1000);
      } else if (time.includes('minute')) {
        const minutes = parseInt(time.match(/\d+/)[0]);
        timestamp = new Date(now.getTime() - minutes * 60000);
      } else if (time.includes('hour')) {
        const hours = parseInt(time.match(/\d+/)[0]);
        timestamp = new Date(now.getTime() - hours * 3600000);
      } else if (time.includes('day')) {
        const days = parseInt(time.match(/\d+/)[0]);
        timestamp = new Date(now.getTime() - days * 86400000);
      } else {
        timestamp = now; // Default to current time if format not recognized
      }

      return {
        rawText: time,
        timestamp: timestamp.toISOString(),
        unixTime: timestamp.getTime()
      };
    });

    return {
      success: true,
      action: "Extracted all notification time information and converted to timestamps",
      extractedData: {
        timeStamps: timeStamps,
        processedTimestamps: timestampData,
        count: timeStamps.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

